    $sql = "SELECT `schulen`.*, `schulen_abteilungen`.`schulform`, `schulform`.`kuerzel`
FROM `schulen` 
	LEFT JOIN `schulen_abteilungen` ON `schulen_abteilungen`.`schule_skz` = `schulen`.`skz` 
	LEFT JOIN `schulform` ON `schulen_abteilungen`.`schulform` = `schulform`.`id`";
    $result = $conn->query($sql);
    if ($result->num_rows > 0) {
        while ($row = $result->fetch_assoc()) {
            $koords = $row['koords'];
            $skz = $row['skz'];
            $strasse = $row['strasse'];
            $ort = $row['ort'];
			$name = $row['name'];
            $kuerzel = $row['kuerzel'];
            if ($kuerzel == "SS") {
                $kuerzel = "Sonderschule";
            } else if ($kuerzel == "MS") {
                $kuerzel = "Mittelschule";
            }
            $sf_bezeichnung = $row['abteilungen'];
            $sf_beschreibung = $row['beschreibung'];
            $plz = $row['plz'];
            if ($row['schulform_id'] == 4) { // Poly
                $icon_color = 'greenPin';
            } else if ($row['schulform_id'] == 2) { // Mittelschule
                $icon_color = 'orangePin';
            } else if ($row['schulform_id'] == 1) { // Volkschule
                $icon_color = 'bluePin';
            } else if ($row['schulform_id'] == 6) { // Sonderschule
                $icon_color = 'yellowPin';
            } else if(strpos($name, "BORG") !== false){ // Berufsschule
                $icon_color = 'aquaPin';
            } else if(strpos($name, "HTL") !== false || strpos($name, "HAK") !== false || strpos($name, "HLW") !== false) { // alle weiteren Schulen
                $icon_color = 'purplePin';
            }
			$icon_color = $row['icon_color'];
            if ($koords != ", ") {
                echo "
            L.marker([" . $koords . "], {icon: " . $icon_color . "}).addTo(map)
            .bindPopup('<div style=\"text-align: center;\"><h2>" . $name . "</h2><b>Allgemeines</b></div><b>Bezeichnung:</b> " . $sf_bezeichnung . "<br><b>Adresse: </b>" . $strasse . ", " . $plz . " " . $ort;
                // fetch "Abteilungen" of current school
                $sql_abteilungen = "SELECT id, name FROM schulen_abteilungen WHERE schule_skz = $skz";
                $result_abteilungen = $conn->query($sql_abteilungen);
                if ($result_abteilungen->num_rows > 0) {
                    echo "<br><div style=\"text-align: center;\"><b>Abteilungen</b></div> ";
                    while ($row = $result_abteilungen->fetch_assoc()) {
                        $abteilung_id = $row['id'];
                        echo "<b>" . $row['name'] . "</b>";
                        // fetch "Schwerpunkte" of current "Abteilung"
                        $sql_schwerpunkte = "SELECT bezeichnung, auspraegung FROM schulen_schwerpunkte WHERE abteilung_id = $abteilung_id";
                        $result_schwerpunkte = $conn->query($sql_schwerpunkte);
                        $result_number = $result_schwerpunkte->num_rows;
                        if ($result_schwerpunkte->num_rows > 0) {
                            echo ": <br>";
                            $count = 0;
                            while ($row = $result_schwerpunkte->fetch_assoc()) {
                                if ($count < 3) {
                                    echo "- " . $row['bezeichnung'] . " (" . $auspraegung . ")<br>";
                                } else {
                                    $rest_count = $result_number - $count;
                                    echo "<b><div style=\"text-align: center;\">[Noch " . $rest_count . " weitere]</div></b>";
                                    break;
                                }
                                $count++;
                            }
                        } else {
                            echo "<br>";
                        }
                    }
                }
                echo '<br><div style=\"text-align: center;\"><a href="detail?schule=' . $skz . '"> Weitere Details ...</a></div>';
                echo "')";
            }
        }
    }

